CREATE PROCEDURE `proforma_facturar` (`idprof` INT, `vidusu` INT, `caja` INT)  BEGIN
                        declare vid int;
                        DECLARE EXIT handler for sqlexception select 0 as vid; 
                      set vid = 999999;

